   "host_permissions": [ "\u003Call_urls>" ],
   "icons": {
      "128": "icon-128.png"
   },
   "key": "",
   "manifest_version": 3,
   "name": "Claude",
   "options_page": "options.html",
   "permissions": [ "sidePanel", "storage", "activeTab", "scripting", "debugger", "tabGroups", "tabs", "alarms", "notifications", "system.display", "webNavigation", "declarativeNetRequestWithHostAccess", "offscreen", "nativeMessaging", "unlimitedStorage", "downloads" ],
